window.bookSummaryJSON = "<p><b>This time, Kaiden's friend needs a little support....</b></p> <p>Chiyo's father's company is being targeted, and she considers her options. <i>Should she help him? </i></p> <p>The only problem? There is a dark enemy on the other side who wants her dad's company and wouldn't mind taking a bite out of Kaiden, either. </p> <p>Chief is more integrated than he was before and far more fragile due to his neural link with Kaiden. </p> <p>Kaiden and Chiyo been provided a job opportunity, but they will need extra support. </p> <p>Will they be able to call on their friends, or will they need to hire contractors?</p> <p>Will Chiyo's efforts help or hurt her dad? </p> <p>Those at the Ark Academy are training to be the best, but what happens when they have to go up against trained mercenaries who have more experience?</p> <p>You don't become the best of the best by staying alive. In the Animus, you are closer to perfection with each death you suffer. </p> <p>Kaiden Jericho would rather skip the death part, thank you very much.</p> <p><i>Includes special note from co-author Michael Anderle.</i></p>"; 
